import React from "react";
import CustomNav from "./CustomNav/CustomNav";
import Logo from "./Logo/Logo";

const CustomHeader = () => {
  return (
    <div>
      <CustomNav />
      <Logo />
    </div>
  );
};

export default CustomHeader;
